import React from "react"
import {Link,BrowserRouter} from "react-router-dom"
import Button from "./Button"

function App(){
    return(
        <div>
        <BrowserRouter>
       <Link to="/Button"><button>a</button></Link>
       </BrowserRouter>
        </div>
    )
} 



export default App
